import React, { Component } from "react";
import Header from "../Component/Header/Header";
import Footer from "../Component/Footer/Footer";
import Courses from "../Component/Courses/Courses";
import { connect } from "react-redux";
import Fade from 'react-reveal/Fade';
import moduleName from '../Component/Loader/Loader'
class CoursePage extends Component {

constructor(props) {
  super(props)

  this.state = {
    loading: true
  }
}

componentDidMount() {
  setTimeout(() => {
    this.setState({
      loading: false
    });
  }, 2000);
}

  render() {
    let { courses, history } = this.props;

    return (
      <>
        <Header history={history} />
        <Fade><Courses courses={courses} /></Fade>
        <Footer />
      </>
    );
  }
}

const mapStateTopProp = state => {
  return {

    courses: state.Course.course
  };
};

export default connect(mapStateTopProp, null)(CoursePage);
